        [HttpGet("WaybillPOD/{waybillNo}")]
        [SwaggerOperation(Summary = "WaybillPOD by No", Description = "Get a waybills pod by waybillNo and optional node.")]
        public async Task<ActionResult> GetWaybillImagebyWaybillNo(string waybillNo, string nodeName)
        {
            Vendor.Services.Edocs.Auth.Auth authClient = new Vendor.Services.Edocs.Auth.AuthClient();

            string sessionId = (await authClient.loginAsync(new Vendor.Services.Edocs.Auth.login
            {
                Body = new Vendor.Services.Edocs.Auth.loginBody
                {
                    username = userName,
                    password = password
                }
            })).Body.sessionId;

            VirtualPostmanClient vpService = new VirtualPostmanClient();

            if (sessionId == null)
            {
                return NotFound();
            }
            else
            {
                //We get the node ID for the "Final" node. There is also an "Admin" node for admin copies.
                long finalPodsNodeId = 0;
                long crossborderPodsNodeId = 0;
                bool bDoc = false;


                if (nodeName != null)
                {
                    finalPodsNodeId = (await vpService.getNodeIdForNodeNameAsync(sessionId, nodeName)).nodeId;
                    crossborderPodsNodeId = (await vpService.getNodeIdForNodeNameAsync(sessionId, "Waybill Cross Border")).nodeId;
                    bDoc = true;
                }
                else
                {
                    finalPodsNodeId = (await vpService.getNodeIdForNodeNameAsync(sessionId, "Final")).nodeId;
                    crossborderPodsNodeId = (await vpService.getNodeIdForNodeNameAsync(sessionId, "Waybill Cross Border")).nodeId;
                    bDoc = true;
                }

                //We build a list of search parameters. We are searching for all documents where the barcode is 07793855, so we add that as our search parameter.
                List<indexValue> searchIndexes = new List<indexValue>();

                //Create the indexValue object for barcode
                indexValue primaryIndex = new indexValue();
                primaryIndex.indexName = "Barcode";
                primaryIndex.indexValue1 = waybillNo;

                //Add index value object to list of objects.
                searchIndexes.Add(primaryIndex);

                //Get a list of matching documents from server.
                document[] documents = null;
                documents = (await vpService.simpleSearchAsync(sessionId.ToString(), finalPodsNodeId, searchIndexes.ToArray())).documents;

                if (documents == null && nodeName == null)
                {
                    //Check for an Admin copy
                    finalPodsNodeId = (await vpService.getNodeIdForNodeNameAsync(sessionId, "Admin")).nodeId;
                    documents = (await vpService.simpleSearchAsync(sessionId.ToString(), finalPodsNodeId, searchIndexes.ToArray())).documents;

                    bDoc = true;
                }

                if (bDoc)
                {
                    if (documents == null)
                    {
                        //Try for CrossBorder
                        searchIndexes = new List<indexValue>();
                        //Create the indexValue object for barcode
                        indexValue cbPrimaryIndex = new indexValue();
                        cbPrimaryIndex.indexName = "Waybill Number";
                        cbPrimaryIndex.indexValue1 = waybillNo;
                        indexValue cbSecondaryIndex = new indexValue();
                        cbSecondaryIndex.indexName = "Document Type";
                        cbSecondaryIndex.indexValue1 = "CB POD";

                        //Add index value object to list of objects.
                        searchIndexes.Add(cbPrimaryIndex);
                        searchIndexes.Add(cbSecondaryIndex);
                        documents = (await vpService.simpleSearchAsync(sessionId.ToString(), crossborderPodsNodeId, searchIndexes.ToArray())).documents;
                        if (documents == null)
                            return NotFound();
                        else
                        {
                            foreach (document doc in documents)
                            {
                                //Get document content
                                byte[] docContent = (await vpService.getDocumentContentAsPdfAsync(sessionId, doc.id)).documentContentAsPdf;

                                return Ok(docContent);
                            }
                        }
                    }
                    else
                    {
                        foreach (document doc in documents)
                        {
                            //Get document content
                            byte[] docContent = (await vpService.getDocumentContentAsPdfAsync(sessionId, doc.id)).documentContentAsPdf;

                            return Ok(docContent);
                        }
                    }
                }
                else
                {
                    return NotFound();
                }

                return Ok();
            }
        }


        [HttpGet("CustomerStatement/AccountCode/{accountCode}/Period/{period}")]
        [SwaggerOperation(Summary = "Get CustomerStatement by AccountCode and Period", Description = "Get CustomerStatement Image by AccountCode and date Period")]
        public async Task<ActionResult> GetCustomerStatementByAccountCodeandPeriod(string accountCode, DateTime period)
        {

            Vendor.Services.Edocs.Auth.Auth authClient = new Vendor.Services.Edocs.Auth.AuthClient();

            string sessionId = (await authClient.loginAsync(new Vendor.Services.Edocs.Auth.login
            {
                Body = new Vendor.Services.Edocs.Auth.loginBody
                {
                    username = userName,
                    password = password
                }
            })).Body.sessionId;

            VirtualPostmanClient vpService = new VirtualPostmanClient();

            if (sessionId == null)
            {
                return NotFound();
            }
            else
            {

                //We build a list of search parameters. We are searching for all documents where the barcode is 07793855, so we add that as our search parameter.
                List<indexValue> searchIndexes = new List<indexValue>();

                //Create the indexValue object for barcode
                indexValue primaryIndex = new indexValue();
                primaryIndex.indexName = "Customer code";
                primaryIndex.indexValue1 = accountCode;

                indexValue secondaryIndex = new indexValue();
                secondaryIndex.indexName = "Statement date";
                secondaryIndex.indexValue1 = period.Date.AddMonths(1).AddDays(-(period.Day)).ToString("yyyy-MM-dd");

                //Add index value object to list of objects.
                searchIndexes.Add(primaryIndex);
                searchIndexes.Add(secondaryIndex);

                //Get a list of matching documents from server.
                document[] documents = null;
                documents = (await vpService.simpleSearchAsync(sessionId.ToString(), 71, searchIndexes.ToArray())).documents;

                if (documents == null)
                    return NotFound();
                else
                {
                    foreach (document doc in documents)
                    {
                        //Get document content
                        byte[] docContent = (await vpService.getDocumentContentAsPdfAsync(sessionId, doc.id)).documentContentAsPdf;

                        return Ok(docContent);
                    }
                }

                return Ok();
            }

        }


