        [HttpPost("PostProposal/{AccountCode}")]
        [SwaggerOperation(Summary = "Post Proposal", Description = "Post Proposal")]
        public async Task<ActionResult> PostProposal(string AccountCode, IncreaseDocuments document)
        {
            var authenticate = new AuthClient();
            var postman = new VirtualPostmanClient();
            var Session = await authenticate.loginAsync("docdel", "docdel");

            //Add to Edocs
            var indexes = new List<indexValue>
            {
                new indexValue() { indexName = "Cust code", indexValue1 = AccountCode },
                new indexValue() { indexName = "date", indexValue1 = DateTime.Now.ToString("yyyyMMddd") }
            };

            //var content = "";
            //byte[] bytes = Encoding.ASCII.GetBytes(content);

            //Send to Edocs
            var edoc = await postman.archiveFileAsync(Session.sessionId, 66, "application/pdf", document.ImgName, indexes.ToArray(), document.ImgData);
            if (edoc.archivedDocument.id > 0)
            {
                // Update the 
                return Ok(edoc.archivedDocument.id);
            }

            return BadRequest(0);
        }
    }
